/*!50003 CREATE*/ /*!50017 DEFINER=`marko`@`%`*/ /*!50003 TRIGGER `Posudeno_Prodano` AFTER INSERT ON `racun` FOR EACH ROW BEGIN
        IF (new.Posudeno_Prodano = 'Posudeno') THEN
                    insert into Posudeno(ProizvodID, RacunID, Datum_Posudbe, Datum_roka, Cijena_Posudbe, Platforma, PoslovnicaID)
                       values (new.ProizvodID, new.ID, new.datum_placanja, (DATE_ADD(new.datum_placanja, INTERVAL 1 MONTH)), '25kn', new.Platforma, new.PoslovnicaID);
        ELSE 
                  insert into Prodano(ProizvodID, RacunID, Kolicina, Cijena, Platforma, PoslovnicaID)
                       values(new.ProizvodID, new.ID, new.Kolicina, (select Cijena_Za_Kupnju from Proizvod where new.ProizvodID=ID), new.Platforma, new.PoslovnicaID);
    END IF;
END */;;
